  'Label','Show extra label ROIs',...
  'Tag','menu_view_showhide_maroiaux',...
  'Checked','off') ;
moveMenuItemAfter(menu_view_zoom_toggle, handles.menu_view_occluded_points_box);
moveMenuItemAfter(menu_view_pan_toggle, menu_view_zoom_toggle);
moveMenuItemAfter(menu_view_showhide_maroi, menu_view_pan_toggle);
moveMenuItemAfter(menu_view_showhide_maroiaux, menu_view_showhide_maroi);

